selector_to_html = {"a[href=\"#view-user-details\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">View User Details<a class=\"headerlink\" href=\"#view-user-details\" title=\"Link to this heading\">#</a></h2><p>To view a <strong>User\u2019s</strong> details:</p>", "a[href=\"#user-details-accounts-tab\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">User Details - Accounts Tab<a class=\"headerlink\" href=\"#user-details-accounts-tab\" title=\"Link to this heading\">#</a></h2><p>The <strong>User Details</strong> screen also has an <strong>Accounts</strong> tab that allows you to view the accounts associated with the user.</p>", "a[href=\"#user-detail-homepage\"]": "<figure class=\"align-center\" id=\"user-detail-homepage\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-detail-homepage.webp\"><img alt=\"../../_images/user-detail-homepage.webp\" src=\"../../_images/user-detail-homepage.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">View User Details Homepage</span><a class=\"headerlink\" href=\"#user-detail-homepage\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#user-user-save-changes\"]": "<figure class=\"align-center\" id=\"user-user-save-changes\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-save-changes.webp\"><img alt=\"../../_images/user-user-save-changes.webp\" src=\"../../_images/user-user-save-changes.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, Save Changes</span><a class=\"headerlink\" href=\"#user-user-save-changes\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#view-sponsorhip-account\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">View Sponsorhip Account<a class=\"headerlink\" href=\"#view-sponsorhip-account\" title=\"Link to this heading\">#</a></h1>", "a[href=\"#editing-user-details\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Editing User Details<a class=\"headerlink\" href=\"#editing-user-details\" title=\"Link to this heading\">#</a></h4><p>You can edit the following details on the <strong>User Details Homepage</strong>:</p>", "a[href=\"#user-homepage\"]": "<figure class=\"align-center\" id=\"user-homepage\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-homepage.webp\"><img alt=\"../../_images/user-user-homepage.webp\" src=\"../../_images/user-user-homepage.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage</span><a class=\"headerlink\" href=\"#user-homepage\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#user-user-accounts-tab-action-column\"]": "<figure class=\"align-center\" id=\"user-user-accounts-tab-action-column\">\n<a class=\"reference internal image-reference\" href=\"../../_images/accounts-tab-action-section.webp\"><img alt=\"../../_images/accounts-tab-action-section.webp\" src=\"../../_images/accounts-tab-action-section.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, Accounts Tab, Action Column</span><a class=\"headerlink\" href=\"#user-user-accounts-tab-action-column\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#user-details-page\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">User Details Page<a class=\"headerlink\" href=\"#user-details-page\" title=\"Link to this heading\">#</a></h3><p>The <strong>User Details</strong> page allows you to view and edit a specific User\u2019s details.</p>", "a[href=\"#user-user-status-filter\"]": "<figure class=\"align-center\" id=\"user-user-status-filter\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-status-filter.webp\"><img alt=\"../../_images/user-user-status-filter.webp\" src=\"../../_images/user-user-status-filter.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, Status Filter Dropdown</span><a class=\"headerlink\" href=\"#user-user-status-filter\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../_images/created-modified-activity-log.webp\"><img alt=\"../../_images/created-modified-activity-log.webp\" src=\"../../_images/created-modified-activity-log.webp\" style=\"width: 50%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Information Pane</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#user-user-action-column\"]": "<figure class=\"align-center\" id=\"user-user-action-column\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-action-column.webp\"><img alt=\"../../_images/user-user-action-column.webp\" src=\"../../_images/user-user-action-column.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, Action Column</span><a class=\"headerlink\" href=\"#user-user-action-column\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#navigating-the-user-details-homepage\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Navigating the User Details Homepage<a class=\"headerlink\" href=\"#navigating-the-user-details-homepage\" title=\"Link to this heading\">#</a></h3><p>The <strong>User Details</strong> page has various actions available at the bottom-right of the page, including the following options:</p>", "a[href=\"#users\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Users<a class=\"headerlink\" href=\"#users\" title=\"Link to this heading\">#</a></h1><p>The <strong>User</strong> section allows you to manage and view <strong>User</strong> accounts.</p>", "a[href=\"#user-user-accounts-tab\"]": "<figure class=\"align-center\" id=\"user-user-accounts-tab\">\n<a class=\"reference internal image-reference\" href=\"../../_images/accounts-tab.webp\"><img alt=\"../../_images/accounts-tab.webp\" src=\"../../_images/accounts-tab.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, Accounts Tab</span><a class=\"headerlink\" href=\"#user-user-accounts-tab\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-column-options.webp\"><img alt=\"../../_images/user-user-column-options.webp\" src=\"../../_images/user-user-column-options.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User, Column Options</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#filtering-the-user-table\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Filtering the User Table<a class=\"headerlink\" href=\"#filtering-the-user-table\" title=\"Link to this heading\">#</a></h3><p>The <strong>User</strong> table can be filtered by either of the following options:</p>", "a[href=\"#activity-log-section\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Activity Log Section<a class=\"headerlink\" href=\"#activity-log-section\" title=\"Link to this heading\">#</a></h2><p>The <strong>Activity Logs</strong> section contains a list of changes made to the company\u2019s profile.</p><p>Each <strong>Activity Log entry</strong> contains the following:</p>", "a[href=\"#user-user-accounts-tab-column-names\"]": "<figure class=\"align-center\" id=\"user-user-accounts-tab-column-names\">\n<a class=\"reference internal image-reference\" href=\"../../_images/accounts-tab-column-names.webp\"><img alt=\"../../_images/accounts-tab-column-names.webp\" src=\"../../_images/accounts-tab-column-names.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, Accounts Tab, Column Names</span><a class=\"headerlink\" href=\"#user-user-accounts-tab-column-names\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#user-user-view-user-details\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">View User Details<a class=\"headerlink\" href=\"#view-user-details\" title=\"Link to this heading\">#</a></h2><p>To view a <strong>User\u2019s</strong> details:</p>", "a[href=\"../../Account/sponsorship-organization/sponsorship-organizations.html#view-sponsorship-account-section\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">View Sponsorhip Account<a class=\"headerlink\" href=\"#view-sponsorhip-account\" title=\"Link to this heading\">#</a></h1><p>Selecting the <strong>View Account</strong> button will take you to the <strong>Sponsorship Organization Information</strong> screen.</p>", "a[href=\"#user-user-view-more-location\"]": "<figure class=\"align-center\" id=\"user-user-view-more-location\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-view-more-location.webp\"><img alt=\"../../_images/user-user-view-more-location.webp\" src=\"../../_images/user-user-view-more-location.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, View More Icon Location</span><a class=\"headerlink\" href=\"#user-user-view-more-location\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#information-pane\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Information Pane<a class=\"headerlink\" href=\"#information-pane\" title=\"Link to this heading\">#</a></h1><p>The <strong>Information Pane</strong> (Right Column) provides both an <strong>Activity Log</strong> and a <strong>Created &amp; Modified</strong> Section.</p>", "a[href=\"#navigating-the-accounts-tab\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Navigating the Accounts Tab<a class=\"headerlink\" href=\"#navigating-the-accounts-tab\" title=\"Link to this heading\">#</a></h3><p>The <strong>Accounts</strong> tab displays the following columns:</p>", "a[href=\"#using-the-status-dropdown\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Using the Status Dropdown<a class=\"headerlink\" href=\"#using-the-status-dropdown\" title=\"Link to this heading\">#</a></h4><p>The <strong>Status</strong> dropdown can be used to filter the table by these options:</p>", "a[href=\"#action-column-for-accounts-tab\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Action Column for Accounts Tab<a class=\"headerlink\" href=\"#action-column-for-accounts-tab\" title=\"Link to this heading\">#</a></h4><p>The <strong>Action</strong> column has three actions available:</p>", "a[href=\"#user-user-details-accounts-tab-view-icon\"]": "<figure class=\"align-center\" id=\"user-user-details-accounts-tab-view-icon\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-details-accounts-tab-view-icon.webp\"><img alt=\"../../_images/user-user-details-accounts-tab-view-icon.webp\" src=\"../../_images/user-user-details-accounts-tab-view-icon.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, Accounts Tab, View Account Icon</span><a class=\"headerlink\" href=\"#user-user-details-accounts-tab-view-icon\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#navigating-the-user-table\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Navigating the User Table<a class=\"headerlink\" href=\"#navigating-the-user-table\" title=\"Link to this heading\">#</a></h2><p>The homepage displays a table of users with the following columns:</p>", "a[href=\"#user-actions-location\"]": "<figure class=\"align-center\" id=\"user-actions-location\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-actions-location.webp\"><img alt=\"../../_images/user-actions-location.webp\" src=\"../../_images/user-actions-location.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User Actions Location, Bottom Right</span><a class=\"headerlink\" href=\"#user-actions-location\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#user-user-hompage-filter-options\"]": "<figure class=\"align-center\" id=\"user-user-hompage-filter-options\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-hompage-filter-options.webp\"><img alt=\"../../_images/user-user-hompage-filter-options.webp\" src=\"../../_images/user-user-hompage-filter-options.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, Filter Options</span><a class=\"headerlink\" href=\"#user-user-hompage-filter-options\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#created-modified-section\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Created &amp; Modified Section<a class=\"headerlink\" href=\"#created-modified-section\" title=\"Link to this heading\">#</a></h2><p>The <strong>Created &amp; Modified</strong> section contains the following:</p>", "a[href=\"#save-changes\"]": "<img src='/en/stable-edit/_static/solo_app/Universal/buttons/save-changes.jpeg' alt='Save Changes' style='width:200px;'>", "a[href=\"#deactivate-button\"]": "<img src='/en/stable-edit/_static/solo_app/Universal/buttons/deactivate-button.jpeg' alt='Deactivate Button' style='width:200px;'>", "a[href=\"#view-more-icon\"]": "<img src='/en/stable-edit/_static/solo_app/Universal/icons/view-more-icon.jpeg' alt='View More Icon' style='width:200px;'>", "a[href=\"#reset-password\"]": "<img src='/en/stable-edit/en/stable-edit/_static/solo_app/User/User-Detail/reset-password.jpeg' alt='Reset Password' style='width:200px;'>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
